import data from './data'
import './App.css';

function App() {
  return (
    <div >
      <header>
        <main>
          <p>List Products</p>
          <h1>Featured Products</h1>
          <div className="products" > 
            {
              data.products.map(product => (
                <div className="product" key={product.pid} >
                  <a href={`/product/${product.pid}`} >
                  <img src={product.image} />
                  </a>
                  <div>
                  <a href={`/product/${product.pid}`} >
                    <p>{product.name}</p>
                  </a>
                    <p>${product.price}</p>
                  </div>
                </div>
              ))
            }
          </div>
        </main>


      </header>
    </div>
  );
}

export default App;
